import React from 'react';

const Footer = () => {
  return(
    <div className="FooterWrapper">
      <div className="FooterWrapper__item">logo</div>
      <div className="FooterWrapper__item">contact-form</div>
      <div className="FooterWrapper__item">3</div>
      <div className="FooterWrapper__item">4</div>
      <div className="FooterWrapper__item">5</div>
      <div className="FooterWrapper__item">6</div>
    </div>
  )
}

export default Footer;
